const objectCard = {
    template:
    /*html*/
    `
    <div class="objectCard">
        <img class="objectCard-image" :src="objectimage">
        <h5> {{ objectname }} </h5>
        <h6> {{ objectcreator }} </h6>
    </div>
    `,

    
    props: {
        objectname: {
            type: String,
            required: true
        },
        objectimage: {
            type: String,
            required: true
        },
        objectcreator: {
            type: String,
            required: true
        }
    }
}

const app = Vue.createApp({
    data() {
        return {
            search: "",
            searchOption: 0,
            style: "",
            nationality: "",
            medium: "",
            objects: []
        }
    },


    mounted: async function() {
        for(var i = 0; i < testResponse.results.length; i++) {
            var image = testResponse.results[i]["ca_object_representations.media.original"];
            if (image == null) {
                image = "https://www.salonlfc.com/wp-content/uploads/2018/01/image-not-found-scaled-1150x647.png";
            }
            this.objects.push({
                "card": objectCard, 
                "name": testResponse.results[i]["display_label"], 
                "image": image, 
                "creator": testResponse.results[i]["ca_entities.related.preferred_labels.displayname"]
            });
        }
    }
});

app.mount("#ca-browse-app");